(91, NULL, 'Career', 'career', NULL, '<div class=\"user_dashboard\">\r\n<div class=\"container no_pad\">\r\n<div class=\"user_detl_car col-xs-12\">\r\n<div class=\"name-edit-prof\">Careers at MyGrozo</div>\r\n<div class=\"number-email-prof\">Be a part of the product tech industry. Be a part of the future.</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"career\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<div class=\"job\">\r\n<h3 class=\"mb-35\">Field Executives</h3>\r\n<div class=\"\">\r\n<div class=\"title\">\r\n<h4>Job Role</h4>\r\n</div>\r\n<div class=\"discription\">\r\n<p>Meet the Shopkeepers, Explain them the concept of Grozoa and the Benefits to get associated with Grozo.Also get them associated with Grozo. It&rsquo;s a field job and also will have target.</p>\r\n</div>\r\n</div>\r\n<div class=\"\">\r\n<div class=\"title\">\r\n<h4>Salary</h4>\r\n</div>\r\n<div class=\"discription\">\r\n<p>As per Industry Standards.</p>\r\n</div>\r\n</div>\r\n<div class=\"showMoreContent\">\r\n<div class=\"\">\r\n<div class=\"title\">\r\n<h4>Qualification</h4>\r\n</div>\r\n<div class=\"discription\">\r\n<p>Undergraduates / Graduates in any stream, with good Communication Skills.</p>\r\n</div>\r\n</div>\r\n<div class=\"\">\r\n<div class=\"title\">\r\n<h4>Experience</h4>\r\n</div>\r\n<div class=\"discription\">\r\n<p>1-3 years of relevant experience will be desirable.Fresher can also apply (if they are good )</p>\r\n</div>\r\n</div>\r\n<div class=\"\">\r\n<div class=\"title\">\r\n<h4>Languages</h4>\r\n</div>\r\n<div class=\"discription\">\r\n<p>English (Speak, Read &amp; Write), Tamil, Malayalam (Speak)</p>\r\n</div>\r\n</div>\r\n<div class=\"\">\r\n<div class=\"title\">\r\n<h4>Gender</h4>\r\n</div>\r\n<div class=\"discription\">\r\n<p>Male Only</p>\r\n</div>\r\n</div>\r\n<div class=\"\">\r\n<div class=\"title\">\r\n<h4>Age</h4>\r\n</div>\r\n<div class=\"discription\">\r\n<p>22 &ndash; 28 years</p>\r\n</div>\r\n</div>\r\n<div cla